description:
This data set is an index of the cancelled Alpha Public Plan map series for Western Australia. This series of maps represents the first attempt to cover the colony within one integrated cadastral mapping system.

The series consists of the following plan sequences:

K (Kimberley) 80 chain, 1884-1885 (consignment 4897);
K (Kimberley) 300 chain, 1886-1902 (consignment 4898);
K (Kimberley) 600 chain, 1892 (consignment 5471);
DeGrey &amp; Yule 600 chain, 1886 (consignment 4564);
G (Gascoyne) 80 chain, 1883-1886 (consignment 4895);
G (North West) 300 chain, 1886-1905 (consignment 4896);
M (Murchison) 300 chain, 1886-1905 (consignment 4899);
C (Central West) 80 chain, 1881-1905 (consignment 4894);
C (Central West) 160 chain, 1892-1900 (consignment 4565);
S (South West) 80 chain, 1878-1907 (consignment 4900);
S (South West) 80 chain, non-public plans (consignment 4901).

For a detailed description of individual plans within this series please see the "Catalogue of Cancelled Public Plans of Western Australia"' (edited by Andre Mali), Volume 1 Part 1.1.1
